import React, { Component } from "react";
import "./estilos.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class CardVerso extends Component{
    render(){
        return(
            <section className='cardVerso'>
                <div className='card'>
                    <h1>teste do card verso</h1>
                </div>
                
            </section>
        )
    }
}

export default CardVerso;
